import React from "react";

function Register() {
  return (
    <form className="register__form">
      <h3 className="register__title">Вход</h3>
      <input
        className="register__input"
        placeholder="Email"
      />
      <input
        className="register__input"
        placeholder="Пароль"
      />
      <button className="register__button">Зарегистрироваться</button>
    </form>
  )
}

export default Register;
